import React from 'react';
import logo from './Images/NH-Photo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <img src={logo} className="App-logo" alt="logo" />
      <header className="App-header">
      </header>
    </div>
  );
}

export default App;
